import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';


const Home = () => {
  return (
    <Grid container spacing={2}>
      {/* First row */}
      <Grid item xs={12}>
        <Paper>
          <Typography variant="h6">Header</Typography>
        </Paper>
      </Grid>

      {/* Second row */}
      <Grid item xs={6}>
        <Paper>
          <Typography variant="body1">Content 1</Typography>
        </Paper>
      </Grid>
      <Grid item xs={6}>
        <Paper>
          <Typography variant="body1">Content 2</Typography>
        </Paper>
      </Grid>

      {/* Third row */}
      <Grid item xs={3}>
        <Paper>
          <Typography variant="body1">Sidebar</Typography>
        </Paper>
      </Grid>
      <Grid item xs={9}>
        <Paper>
          <Typography variant="body1">Main Content</Typography>
        </Paper>
      </Grid>
    </Grid>


  );
};

export default Home;
